import './App.css';
import { Route, Router, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
    <Routes>
      <Route path="/" element={<MainContent />} /> 

      <Route path="/Login" element={<Login />} /> 
    </Routes>
</div>
  );
}

export default App;
